"use strict";
/* ========== popup form ========== */
let btnForm = document.querySelectorAll('.btn__form, .popup__close');
let openForm = document.querySelector('.popup__form'); 

let handleClick = function() {
    openForm && openForm.classList.toggle('active');
};
btnForm.forEach(function(node) {
    node.addEventListener('click', handleClick, false);
});
/* ========== forms ========== */
/* = inputmask - tel = */ 
let selector = document.querySelectorAll('input[type="tel"]');
let im = new Inputmask('+7 (999) 999-99-99');
im.mask(selector); 

