function validateForms(form, handle) {
    $(form).each(function(){$(this).validate({
            rules: {
                name: "required",
                phone: "required",
                checkbox: "required"
            },
            messages: {
                name: ",   ",
                phone: ",    ",
                checkbox: ""
            },
            submitHandler: handle
        });
    });
};
validateForms('#popup-form, #adventige form', function(form) {
    $.ajax({
        //   
        type: 'POST',
        //     
        url: '/mailer/smart.php',
        //     
        data: $(form).serialize()
    }).done(function(response) {
        //    
        $(form).find('input').val("");
        alert(response.message);
        //  
        $(form).trigger('reset');
    });
});




